import React from "react";
import "./App.css";
import MovieList from "./components/CourseList";
import ButtonSide from "./components/ButtonSide";
import "bootstrap/dist/css/bootstrap.css";
import { Modal } from "./components/Modal/Modal";

function App() {
  return (
    <div className="App">
      <MovieList />
      <ButtonSide />
      <Modal />



    </div>
  );
}

export default App;
